import { WhyCrypto } from './WhyCrypto';
import './index.css';

export default function App() {
  const [count, setCount] = useState(false);
  const [counter, setCounter] = useState(false);

  function handleChange() {
    setCount(true);
    setCounter(true);
  }

  return (
    <div className=" bg-primary text-white ">
      <Header />
      <SeparationLine />
      <Home />
      <SeparationLine />
      <About />
      <SeparationLine />
      <Features />
      <GetStarted />
      <LearnMore />
      <SeparationLine />
      <LearnFrom />
      <WhyCrypto />
    </div>
  );
}
